import Link from 'next/link';

function Header() {
  return (
    <>
      <nav className="flex justify-between">
        <Link href="/">
          <a className="text-red">Logo</a>
        </Link>
        <ul className="flex align-center">
          <li className="text-teal-900 mr-6">Writing</li>
          <li>About</li>
        </ul>
      </nav>
    </>
  );
}

export default Header;
